  'name': '백수정',
  'birthday': '961222',
  'gender': '남자',
  'job': '대학생'
},
{
  'id': 2,
  'image': 'https://placeimg.com/64/64/any',
  'name': '백수정',
  'birthday': '961222',
  'gender': '남자',
  'job': '대학생'
},
{
  'id': 3,
  'image': 'https://placeimg.com/64/64/any',
  'name': '백수정',
  'birthday': '961222',
  'gender': '남자',
  'job': '대학생'
},
]

function App() {
  return (
    <>
      {
        customers.map(c =>{
          <Customer
            id={c.id}
            image={c.image}
            name={c.name}
            birthday={c.birthday}
            gender={c.gender}
            job={c.job}
        />
        })
      }
    </>

  );
}

export default App;
